import axios from 'axios';

const api = axios.create({
    baseURL: 'http://localhost:8080/', // Replace with your backend base URL
});

export const getData = () => {
    return api.get('/endpoint'); // Replace '/endpoint' with your actual backend API endpoint
};

export const sendData = (data) => {
    return api.post('/endpoint', data); // Replace '/endpoint' with your actual backend API endpoint
};

export const loginPost = (data) => {
    return api.post('/login', data);
}

export const loginGet = () => {
    return api.get('/login');
}
